//@ts-ignore
import Logo from "../assets/images/logo.png";
//@ts-ignore
import Search from "../assets/svg/search.svg";
import React from "react";

const StyleClassGroup = {
  headerContainer:
    "flex justify-between items-center max-h-20 min-h-20 border-b border-gray-400 w-screen",
  logo: "w-12 h-12 !mx-[20px]",
  searchContainer:
    "flex justify-between items-center w-full max-w-lg h-10 rounded-lg border border-gray-400 bg-gray-100 px-5 max-[750px]:hidden",
  searchInputWrapper: "flex items-center gap-2.5",
  searchIcon: "w-4 h-4",
  searchInput:
    "border-none bg-transparent outline-none w-full text-base font-inter",
  shortcutHint: "text-sm text-gray-400 font-inter",
  spacer: "w-12 h-12 max-[750px]:hidden",
  menuButtonWrapper: "w-9 h-12 !mx-[20px] !mt-[20px] hidden max-[750px]:block",
  menuLine: "w-full h-[2px] rounded-lg bg-black",
  menuLineSpacing: "!my-[10px]",
};

export const Header: React.FC = () => {
  return (
    <div className={StyleClassGroup.headerContainer}>
      <img src={Logo} alt="Logo" className={StyleClassGroup.logo} />
      <div className={StyleClassGroup.searchContainer}>
        <div className={StyleClassGroup.searchInputWrapper}>
          <img src={Search} alt="Search" className={StyleClassGroup.searchIcon} />
          <input
            type="text"
            placeholder="Search Creative OS"
            className={StyleClassGroup.searchInput}
          />
        </div>
        <span className={StyleClassGroup.shortcutHint}>âŒ˜+K</span>
      </div>
      <div className={StyleClassGroup.spacer} />
      <div className={StyleClassGroup.menuButtonWrapper}>
        <div className={StyleClassGroup.menuLine} />
        <div className={`${StyleClassGroup.menuLine} ${StyleClassGroup.menuLineSpacing}`} />
        <div className={StyleClassGroup.menuLine} />
      </div>
    </div>
  );
};

export default Header;
